INSERT INTO test_tenant_mod_inventory_storage.instance (id, jsonb, creation_date, created_by, instancestatusid, modeofissuanceid, instancetypeid, complete_updated_date) VALUES ('daa7f0eb-d2e7-48a9-abde-3c11975a8c2b', '{"id": "daa7f0eb-d2e7-48a9-abde-3c11975a8c2b", "hrid": "in00000000002", "tags": {"tagList": []}, "notes": [{"note": "Description based on print version record", "staffOnly": false, "instanceNoteTypeId": "6a2533a7-4de2-4e64-8466-074c2fa9308c"}, {"note": "Includes bibliographical references and index", "staffOnly": false, "instanceNoteTypeId": "86b6e817-e1bc-42fb-bab0-70e7547de6c1"}, {"note": "Introduction: manifest narrativity-video games, movies, and art and adaptation / Gretchen Papazian and Joseph Michael Sommers -- The rules of engagement: watching, playing and other narrative processes. Playing the Buffyverse, playing the gothic: genre, gender and cross-media interactivity in Buffy the vampire slayer: chaos bleeds / Katrin Althans -- Dead eye: the spectacle of torture porn in Dead rising / Deborah Mellamphy -- Playing (with) the western: classical Hollywood genres in modern video games / Jason W. Buel -- Game-to-film adaptation and how Prince of Persia: the sands of time negotiates the difference between player and audience / Ben S. Bunting, Jr -- Translation between forms of interactivity: how to build the better adaptation / Marcus Schulzke -- The terms of the tale: time, place and other ideologically constructed conditions. -- Playing (in) the city: the warriors and images of urban disorder / Aubrey Anable -- When did Dante become a scythe-wielding badass? modeling adaption and shifting gender convention in Dante''s Inferno / Denise A. Ayo -- \"Some of this happened to the other fellow\": remaking Goldeneye with Daniel Craig / David McGowan -- Zombie stripper geishas in the new global economy: racism and sexism in video games / Stewart Chang -- Stories, stories everywhere (and nowhere just the same): transmedia texts. \"My name is Alan Wake. I''m a writer.\": crafting narrative complexity in the age of transmedia storytelling / Michael Fuchs -- Millions of voices: Star wars, digital games, fictional worlds and franchise canon / Felan Parker -- The hype man as racial stereotype, parody and ghost in Afro samurai / Treaandrea M. Russworm -- Epic nostalgia: narrative play and transmedia storytelling in Disney epic Mickey / Lisa K. Dusenberry", "staffOnly": false, "instanceNoteTypeId": "5ba8e385-0e27-462e-a571-ffa1fa34ea54"}, {"note": "Description based on print version record", "staffOnly": false, "instanceNoteTypeId": "66ea8f28-d5da-426a-a7c9-739a5d676347"}], "title": "Game on, Hollywood! [electronic resource] : essays on the intersection of video games and cinema / edited by Gretchen Papazian and Joseph Michael Sommers.", "series": [], "source": "MARC", "_version": 1, "editions": [], "metadata": {"createdDate": "2024-07-09T12:01:00.575Z", "updatedDate": "2024-07-09T12:01:00.575Z", "createdByUserId": "fc29eb09-4b56-434a-9fff-b4155a69ba09", "updatedByUserId": "fc29eb09-4b56-434a-9fff-b4155a69ba09"}, "subjects": [{"value": "Motion pictures and video games"}, {"value": "Film adaptations--History and criticism"}, {"value": "Video games--Authorship"}, {"value": "Convergence (Telecommunication)"}], "languages": ["eng"], "indexTitle": "Game on, Hollywood! essays on the intersection of video games and cinema /", "identifiers": [{"value": "1476601852 (electronic bk.)", "identifierTypeId": "8261054f-be78-422d-bd51-4ed9f33c3422"}, {"value": "9781476601854 (electronic bk.)", "identifierTypeId": "8261054f-be78-422d-bd51-4ed9f33c3422"}, {"value": "9780786471140 (softcover : alk. paper)", "identifierTypeId": "fcca2643-406a-482a-b760-7a7f8aec640e"}, {"value": "078647114X (softcover : alk. paper)", "identifierTypeId": "fcca2643-406a-482a-b760-7a7f8aec640e"}, {"value": "(NhCcYBP)ybp10134220", "identifierTypeId": "7e591197-f335-4afb-bc6d-a6d76ca3bace"}], "publication": [], "contributors": [{"name": "Papazian, Gretchen, 1968-", 